/*Table structure for table `animal_agent` */

DROP TABLE IF EXISTS `animal_agent`;

CREATE TABLE `animal_agent` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `animal_id` int(10) unsigned NOT NULL,
  `agent_id` int(10) unsigned NOT NULL,
  `type` enum('breeder','owner') NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_animal_agents_animals1_idx` (`animal_id`),
  KEY `fk_animal_agents_agents1_idx` (`agent_id`),
  CONSTRAINT `fk_animal_agents_agents1` FOREIGN KEY (`agent_id`) REFERENCES `agents` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_animal_agents_animals1` FOREIGN KEY (`animal_id`) REFERENCES `animals` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
