/*Table structure for table `animals` */

DROP TABLE IF EXISTS `animals`;

CREATE TABLE `animals` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `code` varchar(20) DEFAULT NULL,
  `name` varchar(60) NOT NULL,
  `birthdate` datetime DEFAULT NULL,
  `mom` int(10) unsigned DEFAULT NULL,
  `dad` int(10) unsigned DEFAULT NULL,
  `gender` enum('female','male') DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `prefix` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_animals_animals1_idx` (`dad`),
  CONSTRAINT `fk_animals_animals1` FOREIGN KEY (`dad`) REFERENCES `animals` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=2130 DEFAULT CHARSET=utf8;

