/*Table structure for table `catalogs` */

DROP TABLE IF EXISTS `catalogs`;

CREATE TABLE `catalogs` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `number` smallint(5) unsigned DEFAULT NULL,
  `category_id` int(11) DEFAULT NULL,
  `tournament_id` int(10) unsigned NOT NULL,
  `animal_id` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_catalog_tournaments1_idx` (`tournament_id`),
  KEY `fk_catalog_animals1_idx` (`animal_id`),
  CONSTRAINT `fk_catalog_animals1` FOREIGN KEY (`animal_id`) REFERENCES `animals` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_catalog_tournaments1` FOREIGN KEY (`tournament_id`) REFERENCES `tournaments` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
